text:
"ประเด็นการพัฒนาลำน้ำเสียวประสบปัญหาซ้ำซากทุกปีในช่วงน้ำหลากก็จะประสบปัญหาน้ำท่วมไม่สามารถกักเก็บน้ำไว้ใช้ในฤดูแล้งได้ฝากท่านประธานผ่านไปยังหน่วยงานที่เกี่ยวข้องให้ดำเนินการศึกษาและพัฒนาลำน้ำเสียวอย่างเป็นระบบเพื่อแก้ปัญหาในระยะยาว"จิราพรสินธุไพร
@nahm_s
#ประชุมสภา

ผู้ว่าฯนราธิวาสประกาศ7อำเภอคือจะแนะรือเสาะระแงะศรีสาครสุคิรินแว้งและสุไหงโกลกประสบภัยพิบัติน้ำท่วมมี32ตำบล79หมู่บ้าน9ชุมชน14,000กว่าครัวเรือนและประชาชนกว่า60,000คนได้รับความเดือดร้อนสั่งการให้จนท.เร่งช่วยเหลือ
@ThaiPBS

@ThaiPBSNews

จ.นราธิวาสประกาศเขตพื้นที่ประสบสาธารณภัย(อุทกภัย)5อำเภอสุคิรินรือเสาะแว้งจะแนะและศรีสาครหลังฝนตกหนักติดต่อกันหลายวันส่งผลให้เกิดน้ำท่วมหลายพื้นที่รวมทั้งภายในเขตเทศบาลสุไหงโกลกเช้านี้
@TNAMCOT

